//www.baidu.com/</a></div><p data-v-7f7cf6ce>项目介绍：</p><p style="line-height:1.4;font-weight:500;" data-v-7f7cf6ce> 个人项目，从2022年02月18日开始开发，包括个人博客，后台管理，以及后端部分。前端用vue3全家桶+ts+less+element-ui开发，后端用express+mongodb进行开发，使用axios进行前后端交互。 目前可以通过个人博客网站查看文章数据，后台已经实现文章管理模块和分类管理模块以及文件上传模块，共计10个接口，功能仍在积极拓展中。 </p><p data-v-7f7cf6ce>项目亮点：</p><p data-v-7f7cf6ce>1：前端使用vue3的composition API结合typescript类型声明进行开发</p><p data-v-7f7cf6ce> 2：后台开发时封装page-content组件并在页面之间进行复用，传入配置对象可以快速构建页面 </p><p data-v-7f7cf6ce>3：使用IntersectionObserve进行懒加载，避免一次性发送全部请求</p><p data-v-7f7cf6ce>4：node编写后端，配合中间件进行开发</p><p data-v-7f7cf6ce>5：个人博客的大部分页面对手机端进行了适配</p></div><div class="project" data-v-7f7cf6ce><div class="title" data-v-7f7cf6ce>富家乡村网上纪念馆</div><div data-v-7f7cf6ce> 页面地址： <a href="http://www.fjxiangcun.com/" data-v-7f7cf6ce>http://www.fjxiangcun.com/</a></div><p style="line-height:1.4;font-weight:500;" data-v-7f7cf6ce> 团队项目，开发周期为1个月，个人负责前台与后台部分。前台与后台用vue2全家桶+element-ui开发，通过axios进行前后端交互。前台作为商用网站，有10+个页面，经过不断地优化，即将投入使用。后台包括用户管理，角色管理，墓碑信息管理等模块。 </p><p data-v-7f7cf6ce>项目亮点：</p><p data-v-7f7cf6ce>1：后台使用动态路由进行权限管理</p><p data-v-7f7cf6ce>2：使用vuex对数据进行统一管理，简化了繁琐的父子组件通信</p></div></div>',1),$=Object(a["defineComponent"])({setup:function(e){var t=Object(a["ref"])([{label:"javascript",percentage:70,color:"#beedc7"},{label:"html+css",percentage:60,color:"#19caad"},{label:"vue",percentage:65,color:"#a0eee1"},{label:"typescript",percentage:45,color:"#ecad9e"},{label:"webpack",percentage:35,color:"#d1ba74"},{label:"node",percentage:60,color:"#e6ceac"}]);return function(e,c){var o=h;return Object(a["openBlock"])(),Object(a["createElementBlock"])("div",w,[x,Object(a["createElementVNode"])("div",C,[Object(a["createElementVNode"])("div",S,[Object(a["createElementVNode"])("div",E,[B,(Object(a["openBlock"])(!0),Object(a["createElementBlock"])(a["Fragment"],null,Object(a["renderList"])(t.value,(function(e){return Object(a["openBlock"])(),Object(a["createElementBlock"])("div",{class:"skill",key:e.label},[Object(a["createElementVNode"]